package springweb.z01_vo;

public class Code {
	
	private String key;
	private String val;
	
	
	public Code() {
		// TODO Auto-generated constructor stub
	}
	public Code(String key, String val) {
		this.key = key;
		this.val = val;
	}
	public String getKey() {
		return key;
	}
	public void setKey(String key) {
		this.key = key;
	}
	public String getVal() {
		return val;
	}
	public void setVal(String val) {
		this.val = val;
	}
	
	
}
